  true,\n\t\"url\": null,\n\t\"notes\": \"On July 1, NITRD released the National Privacy
  Research Strategy. Research agencies across government participated in the development
  of the strategy, reviewing existing Federal research activities in privacy-enhancing
  technologies, soliciting inputs from the private sector, and identifying priorities
  for privacy research funded by the Federal Government. The National Privacy Research
  Strategy calls for research along a continuum of challenges, from how people understand
  privacy in different situations and how their privacy needs can be formally specified,
  to how these needs can be addressed, to how to mitigate and remediate the effects
  when privacy expectations are violated.\",\n\t\"license_title\": \"Other License
